# Examples of using the TRACKmap helper method.

from geofurlong import Geofurlong


gf = Geofurlong()

# Loop through the TRACKmap books, 1 to 5.
for trackmap_book in range(1, 6):
    coverage = gf.trackmap_coverage(trackmap_book)

    trackmap_book = str(trackmap_book)
    trackmap_set = set()

    # Loop through all ELRs.
    for elr_code in gf.elr_codes:
        elr_trackmaps = gf.elr(elr_code).trackmaps
        if any(trackmap_book == trackmap_code for trackmap_code, _ in elr_trackmaps):
            # ELR is in this TRACKmap book.
            trackmap_set.add(elr_code)

    trackmap_list = list(trackmap_set)
    trackmap_list.sort()

    print(f"TRACKmap book {trackmap_book} covering {coverage} contains {len(trackmap_list)} ELRs")
    print(trackmap_list)
    print()


